Steps to Use this Text to  Survey for Event/Experience Survey
1. Copy this workflow; 2. Modify the Default value of the Event Name Attribute; 
3. Modify the workflow type in the block settings of https://www.fellowshipgreenville.org/page/995; 
4. Modify the Defined Type Value - Text to Workflow - Keyword Event/Experience Survey template with appropriate keyword and Workflow Type.; 
5. Test your text to workflow.
